import React from 'react';
import GalleryItem from './GalleryItem';
import './styles/ImageGallery.css';
import ImageOne from "./styles/Images/Customize.jpg"

const ImageGallery = () => {
  const images = [
    { src: {ImageOne}, caption: 'Caption 1' },
    { src: 'path_to_image2.jpg', caption: 'Caption 2' },
    { src: 'path_to_image3.jpg', caption: 'Caption 3' },
    // Add more images as needed
  ];

  return (
    <div className="imageGallery">
      {images.map((image, index) => (
        <GalleryItem key={index} imageSrc={image.src} caption={image.caption} />
      ))}
    </div>
  );
};

export default ImageGallery;
